void load_ecg_data_to_stream(hls::stream<float> &stream, float ecg_data[198]) {
    for (int i = 0; i < 198; i++) {
		stream.write(ecg_data[i]);
    }
}

void load_rr_data_to_stream(hls::stream<float> &stream, float rr_data[2]) {
    for (int i = 0; i < RR_FEATURES; i++) {
		stream.write(rr_data[i]);
    }
}

