void ecg_transformer_top(
    float ecg_data[198], 
    float rr_data[2],
    float predictions[5]
) {

    #pragma HLS INTERFACE m_axi port=ecg_data offset=slave bundle=gmem0 max_read_burst_length=256
    #pragma HLS INTERFACE m_axi port=rr_data offset=slave bundle=gmem1 max_read_burst_length=256
    #pragma HLS INTERFACE m_axi port=predictions offset=slave bundle=gmem2 max_write_burst_length=256
    #pragma HLS INTERFACE s_axilite port=return


    float local_ecg[198];
    float local_rr[2];
    
    // Copy input data to local arrays
    for (int i = 0; i < 198; i++) {
        local_ecg[i] = ecg_data[i];
    }
    
    for (int i = 0; i < 2; i++) {
        local_rr[i] = rr_data[i];
    }
    
    hls::stream<float> output_stream("output");
    #pragma HLS stream variable=output_stream depth=8
    
    ecg_transformer(output_stream, local_ecg, local_rr);
        
    // Read output predictions from stream
    for (int i = 0; i < 5; i++) {
		predictions[i] = output_stream.read();
    }
}
